remarks.example:
In this case, invoke the callback on the multiplexer as follows:

// Call this JS function from say a button's onclick
function OnMultiPanelRefresh(param)
{
    // The server side code will decide which panels to refresh.
    // Append "__sf" to the element's ID, which is "CallbackMultiplexer1" in this case.
    __sfCallbackMultiplexer1.callback(param);
    // Note that if you happen to use this control within a  (or a ) then 
    // the client object instance name will be scoped by the UserControl instance's id (for example: "__sfWebUserControl1_CallbackPanel1").
}

Then, on the server side, in the multiplexer's Callback event handler.

protected void CallbackMultiplexer1_Callback(object sender, Syncfusion.Web.UI.WebControls.CallbackEventArgs e)
{
    if(e.CallbackArgument == "Something")
    {
        // Refresh elements within the CallbackPanel1.
        ....
        // Then add this CallbackPanel1 to the list of controls the multiplexer should refresh
        this.CallbackMultiplexer1.ControlsToRefresh.Add(this.CallbackPanel1);
    }
    else if(e.CallbackArgument == "Something Else")
    {
        // Refresh elements within the CallbackPanel2.
        ....
        // Then add this CallbackPanel2 to the list of controls the multiplexer should refresh
        this.CallbackMultiplexer1.ControlsToRefresh.Add(this.CallbackPanel2);
    }
}


Protected  Sub CallbackMultiplexer1_Callback(ByVal sender As Object, ByVal e As Syncfusion.Web.UI.WebControls.CallbackEventArgs)
    If e.CallbackArgument = "Something" Then
        ' Refresh elements within the CallbackPanel1.
        ....
        'Then add this CallbackPanel1 to the list of controls the multiplexer should refresh
        Me.CallbackMultiplexer1.ControlsToRefresh.Add(Me.CallbackPanel1)
    Else If e.CallbackArgument = "Something Else" Then 
        ' Refresh elements within the CallbackPanel2.
        ....
        ' Then add this CallbackPanel2 to the list of controls the multiplexer should refresh
        Me.CallbackMultiplexer1.ControlsToRefresh.Add(Me.CallbackPanel2)
    End If
End Sub

