remarks.code:
protected void CallbackPanel1_CallbackRefresh(object sender, Syncfusion.Web.UI.WebControls.CancellableCallbackEventArgs e)
{
    if(e.CallbackArgument == "something")
    {
        // label1 is within this CallbackPanel.
        this.label1.Text = "Some other text";
    }
    else if(e.CallbackArgument == "xyz")
    {
        // You don't want to update anything, so prevent refreshing.
        e.Cancel = true;
    }
}

remarks.example:
// If the PopupControlContainer's ID is "PopupControlContainer1"

// This will show the popup beside the parent-control specified in ParentControlID and based on the
// PositionHorizontal and PositionVertical settings.
_sfPopupControlContainer1.ShowPopup();

// If the control has a valid ParentControlID, then this will show the popup at a location adjacent 
// to the "parent control" but adjusted by the specified x and y values;
// If the control does not have a valid ParentControlID, then the popup will be shown at the specified
// location in the page.
_sfPopupControlContainer1.ShowPopup(10, -10);

member.summary:
UniqueClientHTMLManager is used to work around trouble with unpredictable output order of scripts registered by Page.RegisterClientScriptBlock(). UniqueClientHTMLManager builds itself into page instance, thus all calls to Page.RegisterClientScriptBlock() will be transparently "rerouted" via UniqueClientHTMLManager internals. Each unique HTML block (literally client HTML text parts) can be registered using this mechanism. All data registered before calling Ensure() method remains intact. CSS files links can also be registered via calls to Page.RegisterClientScriptBlock().
To enable UniqueClientHTMLManager the following code should be added in OnLoad or OnInit:
UniqueClientHTMLManager.Ensure( this.Page );

member.example:
protected override void OnLoad(EventArgs e)
{
	UniqueClientHTMLManager.Ensure( this.Page );

	base.OnLoad (e);
}
